import React from "react";

import classes from "./signUp.module.css";

function SignUp(props) {
  return (
    <div className={classes.bg}>
        <div className={classes.createAcc}>
            <p className={classes.head}>Create Account</p>
        </div>
    </div>
  );
}

export default SignUp;
